import React from 'react';
import "./TextInput.css";

interface IProps{
    value?:string,
    name:string,
    placeholder:string,
    style?:{},
    defaultValue?:string,
    onChange:(event:React.ChangeEvent<HTMLInputElement>) => void
}

function TextInput({value,name,placeholder,style,onChange,defaultValue} :IProps) {
  return (
    <input 
        className='TextInput'
        value={value}
        name={name}
        placeholder={placeholder}
        style={style}
        onChange={onChange}
        defaultValue={defaultValue}
    />
  )
}

export default TextInput
